import React from 'react'
import './Backdrop.css'

const backdropRoot = document.getElementById('backdrop')

export default function Backdrop(props) {
  return (
    ReactDOM.createPortal(
    <div className={`backdrop, ${props.className}`}>
      {props.children}
    </div>, backdropRoot)
  )
}
